Luxuoso Sobrado em condomínio de Altíssimo Padrão Altos da Serra II no Urbanova.
Projeto com 459m² de área construída e terreno de 516m².
- 4 Suítes com armários planejados;
- Sala 3 ambientes;
- Cozinha planejada;
- Lavabo;
- Área gourmet com churrasqueira;
- Piscina;
Tudo de primeira
Obs: Estuda imóvel como parte de pagamento de preferencia terreno em condominio (Inclusive na região de Sorocaba)
Imóvel com excelente topografia, plano, na parte alta, sendo sua localização privilegiada no residencial.
Bairro fechado, rua tranquila e sem saída.
Imóvel já cercado (construção em ambos os lados e nos fundos).
O Residencial Altos da Serra II é bairro nobre e consolidado que está situado no Urbanova, zona Oeste da cidade de São José dos Campos/SP.
Possui fácil acesso.
A Região do Urbanova, se destaca na cidade, por sua qualidade de vida, segurança, beleza e natureza.
Proporcionado aos seus moradores espaços para a prática de esportes e convivência.
Possui ampla e crescente oferta de comércios e serviços de todos os tipos, atendendo bem seus moradores e frequentadores.
Em suas proximidades estão situados o Parque do Ribeirão Vermelho, Univap, os melhores colégios da cidade, Hospital VIVALLE e o Colinas Shopping.

Terreno comercial no loteamento Setville Altos de São José. Frente para duas ruas. Metragem de 290m² (10x29). Confrontante com o condomínio Setville, que vai contar com os seguintes itens:
- Parque Infantil;
- 6 Parques de lazer;
- Minicampos de Futebol;
- Academia ao ar livre;
- Mesas de jogos;
- Área verde para sua família;
- Mais de 30.000 árvores;
- 1.100 árvores frutíferas;
- Ciclovia de 2,5 km;
- Próximo a grandes empresas.
Aceita parcelamento, e carro como parte de pagamento.

