4 dormitórios, 4 suítes, 4 vagas de garagem , Hobby box;
Área de lazer: 5.000 m²; 1 torre. ! Central Park Jardim Aquarius, com mais de 30 itens de lazer frente a principal praça do Aquárius, edifício ainda conta com vários diferenciais dentre eles: Gerador de energia, aquecimento de água por placa solar, captação de água de chuva e etc.
